import React, { Component } from "react";

class Login extends Component() {
  constructor(props) {
    super(props);

    this.state = {
      email: "",
      password: ""
    };
  }
  render() {
    return (
      <div className="form">
        <h2>I already have an account</h2>
        <span>Login with your email and password</span>
      </div>
    );
  }
}

export default Login;
